  // Helper to format date as YYYY-MM-DD in local timezone (avoids UTC conversion issues)
  const formatLocalDate = (date) => {
    const year = date.getFullYear();
    const month = String(date.getMonth() + 1).padStart(2, '0');
    const day = String(date.getDate()).padStart(2, '0');
    return `${year}-${month}-${day}`;
  };

  // Helper to parse date string (YYYY-MM-DD) in LOCAL timezone
  // Prevents timezone conversion issues when displaying dates
  const parseLocalDate = (dateString) => {
    if (!dateString) return new Date();
    if (dateString instanceof Date) return dateString;
    
    // Handle ISO format with timestamp (e.g., "2026-02-15T05:00:00.000Z")
    if (dateString.includes('T')) {
      dateString = dateString.split('T')[0]; // Extract just the date part
    }
    
    const [year, month, day] = dateString.split('-').map(Number);
    return new Date(year, month - 1, day);
  };

  // Helper function to add months properly (handles month-end dates)
  const addMonthsToDate = (date, months) => {
    const result = new Date(date);
    const startDay = result.getDate();
    
    result.setMonth(result.getMonth() + months);
    
    // If the day changed (e.g., Jan 31 -> Feb 28), it means the target month
    // doesn't have that many days. Keep it as the last day of that month.
    // But if we want to maintain the original day for future months, we need
    // to track the intended day separately from the actual date.
    
    // Better approach: add months to year/month, then set day to min(startDay, lastDayOfMonth)
    const targetMonth = new Date(date).getMonth() + months;
    const targetYear = new Date(date).getFullYear() + Math.floor(targetMonth / 12);
    const normalizedMonth = ((targetMonth % 12) + 12) % 12;
    
    // Get last day of target month
    const lastDay = new Date(targetYear, normalizedMonth + 1, 0).getDate();
    
    // Use original day or last day of month, whichever is smaller
    const finalDay = Math.min(startDay, lastDay);
    
    return new Date(targetYear, normalizedMonth, finalDay);
  };

  // Loan calculation functions
  const calculateMonthlyPayment = (principal, rate, term, type, startDate) => {
    const schedule = [];
    const monthlyRate = rate / 100;
    
    // Parse date correctly to avoid timezone issues
    // startDate format is "YYYY-MM-DD"
    const [year, month, day] = startDate.split('-').map(Number);
    const start = new Date(year, month - 1, day); // month is 0-indexed in JS
    
    
    if (type === 'interest-only') {
      const monthlyInterest = (principal * rate) / 100;
      for (let i = 1; i <= term; i++) {
        const isLastMonth = i === term;
        const dueDate = addMonthsToDate(start, i);
        
        schedule.push({
          month: i,
          payment: isLastMonth ? principal + monthlyInterest : monthlyInterest,
          principal: isLastMonth ? principal : 0,
          interest: monthlyInterest,
          balance: isLastMonth ? 0 : principal,
          dueDate: formatLocalDate(dueDate),
          status: 'pending'
        });
      }
    } else if (type === 'flat-rate') {
      const totalInterest = (principal * rate * term) / 100;
      const monthlyPayment = (principal + totalInterest) / term;
      const principalPerMonth = principal / term;
      const interestPerMonth = totalInterest / term;
      
      for (let i = 1; i <= term; i++) {
        const dueDate = addMonthsToDate(start, i);
        
        schedule.push({
          month: i,
          payment: monthlyPayment,
          principal: principalPerMonth,
          interest: interestPerMonth,
          balance: principal - (principalPerMonth * i),
          dueDate: formatLocalDate(dueDate),
          status: 'pending'
        });
      }
    } else if (type === 'amortized') {
      const monthlyPayment = (principal * monthlyRate * Math.pow(1 + monthlyRate, term)) / (Math.pow(1 + monthlyRate, term) - 1);
      let balance = principal;
      
      for (let i = 1; i <= term; i++) {
        const interest = balance * monthlyRate;
        const principalPaid = monthlyPayment - interest;
        balance -= principalPaid;
        
        const dueDate = addMonthsToDate(start, i);
        
        schedule.push({
          month: i,
          payment: monthlyPayment,
          principal: principalPaid,
          interest: interest,
          balance: Math.max(0, balance),
          dueDate: formatLocalDate(dueDate),
          status: 'pending'
        });
      }
    } else if (type === 'staggered') {
      const principalPerMonth = principal / term;
      let balance = principal;
      
      for (let i = 1; i <= term; i++) {
        const interest = (balance * rate) / 100;
        const payment = principalPerMonth + interest;
        balance -= principalPerMonth;
        
        const dueDate = addMonthsToDate(start, i);
        
        schedule.push({
          month: i,
          payment: payment,
          principal: principalPerMonth,
          interest: interest,
          balance: Math.max(0, balance),
          dueDate: formatLocalDate(dueDate),
          status: 'pending'
        });
      }
    }
    
    return schedule;
  };

